function PageReady(){if($("#SwitchPage").length>0&&"none"!==$("#SwitchPage").css("display")){var e=window.location.pathname+window.location.search,t=e.substring(0,e.indexOf("/article")),i=e.split("/article/")[1].split("?")[0].split("/")[0],a=new URLSearchParams(window.location.search).get("dirid"),l=null==a?null:a.split(",").map(Number);$("#SwitchPage .btn_list").attr("href",t),Directory.SwitchPage({id:i,dirids:l,routername:t.substring(t.lastIndexOf("/")+1),type:2}).done((function(e){if(e.length>0){if(null!=e[0].key){$("#SwitchPage .btn_prev").removeClass("disabled");var i=`${t}/article/${e[0].key}`;$("#SwitchPage .btn_prev").attr({href:i,title:e[0].value})}if(null!=e[1].key){$("#SwitchPage .btn_next").removeClass("disabled");i=`${t}/article/${e[1].key}`;$("#SwitchPage .btn_next").attr({href:i,title:e[1].value})}}else $("#SwitchPage").remove()}))}}